column8:
社外オーディオや、ナビゲーションシステムを取り付けた場合に使用できなくなるステアリングスイッチを使用可能にするユニットです。<br>
左側オーディオ系スイッチ５ボタン（ボリュームアップ、ボリュームダウン、１つ送る、１つ戻す、モード）と右側ナビ系スイッチ３ボタン（オンフック、オフフック、ボイス）の計８ボタンが使用できるようになります。
<hr>【特徴】<br>カーナビのリモコンを学習させる「学習型リモコン」、学習させずに内蔵しているリモコンデータを設定できる「プリセット型リモコン」の両方の機能を搭載しています。これにより、ユーザーの好きなボタン配列にもできますし、カーナビ／カーオーディオにリモコンが無い場合にも対応できます。<br><br>【取り付け簡単】<br>僅か５本の配線を接続するだけで使用可能。詳細な取り付け解説書が付属するので取り付けに迷うこともありません。<hr>【適合車種】<br>30プリウス/40プリウスα<br>
<br>
<div id="galleyra">

</div>
<br>※ご不明点ございましたら、お問い合わせ下さい。TEL：06-6858-8886<hr>【付属品】<br>ユニット本体、赤外線送信部、取付解説書、保証書（解説書に記載）<br>







